  false,\n\t\"url\": null,\n\t\"notes\": \"Benthic fauna and sediment in the vicinity
  of the Barbers Point (Honouliuli) ocean outfall were sampled from 1986-2010. To
  assess the environmental quality, sediment grain size and sediment chemistry were
  measured. To identify the fauna, mollusk species and nonmollusk species sitings
  were tabulated. Stations were located both within and on the boundary of the zone
  of initial dilution (ZID) and at distances of 1.2 to 2 km from the ZID boundary.
  Data are provided in MS Excel spreadsheets. This set is an update to NODC Accession
  9900098.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
